import React from "react";
import home from "./home";
import contact from "./contact";
import about from "./about";
import blog from "./blog";

function NavComponent() {
  return (
    <div>
      <ul>
        <li>
          <home />
        </li>
        <home />
        <contact />
        <about />
        <blog />
      </ul>
    </div>
  );
}
export default NavComponent;
